(293809, 'C0026594156', 'Published to Global Partner', 'Hello dear sponsor Lynda; I send a very big regard to your beuatiful person. May the almighty God be with you. Well, I write you to thank you for the letter you sent to me. It gave me a lot of pleasure to get your nice letter. My family thanks you for all the support. I want to tell you about my life. I was alone at my house because my mom goes to work. I was cooking, washing clothes, ordering the bedrooms and I also played a lot with my sisters. One day we went to the water pool. There, I had a lot of fun, but I did not learn how to swim. I have to practice a lot. I arrived to my house very tired. Now, classes will start. I am excited because I will meet my friends again and will do my homework. Well, I say good bye with lvoe. May God bless you. Deysi Pari Pray for my family and for all the old people.', 'Hello dear sponsor Lynda; I send a very big regard to your beuatiful person. May the almighty God be with you. Well, I write you to thank you for the letter you sent to me. It gave me a lot of pleasure to get your nice letter. My family thanks you for all the support. I want to tell you about my life. I was alone at my house because my mom goes to work. I was cooking, washing clothes, ordering the bedrooms and I also played a lot with my sisters. One day we went to the water pool. There, I had a lot of fun, but I did not learn how to swim. I have to practice a lot. I arrived to my house very tired. Now, classes will start. I am excited because I will meet my friends again and will do my homework. Well, I say good bye with lvoe. May God bless you. Deysi Pari Pray for my family and for all the old people.', 'BO-E-4S01-1', 'From Beneficiary', 'Works7 Communication', '3/13/2018 9:42 AM', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293810, 'C0026642445', 'Published to Global Partner', '1. Hello dear friend Elizabeth, I send you greetings and hugs. I want to thank you for sending me your letter, I liked it a lot and for the present, I bought a pair of tennis. I also want to tell you that I had a great time on my birthday because I was with my uncles/aunts and siblings. I*m doing vey well at school, they already send me homework and the school was very nice. Tell you that I also have a great time here at church, we do many interesting and beautiful things. In my family everything goes very well. My little nephew?s birthday was very nice, we all sing for him and the most beautiful was that he turned 2 years. Everything was very nice because like it was a holiday we went for a walk with my parents and then we played with many people. It was really nice. This is the saddest moment when I have to say goodbye sending you this letter. With much love, Carla 2. I ask you to pray for my parents, siblings and for my studies and for me', '1. Hello dear friend Elizabeth, I send you greetings and hugs. I want to thank you for sending me your letter, I liked it a lot and for the present, I bought a pair of tennis. I also want to tell you that I had a great time on my birthday because I was with my uncles/aunts and siblings. I*m doing vey well at school, they already send me homework and the school was very nice. Tell you that I also have a great time here at church, we do many interesting and beautiful things. In my family everything goes very well. My little nephew?s birthday was very nice, we all sing for him and the most beautiful was that he turned 2 years. Everything was very nice because like it was a holiday we went for a walk with my parents and then we played with many people. It was really nice. This is the saddest moment when I have to say goodbye sending you this letter. With much love, Carla 2. I ask you to pray for my parents, siblings and for my studies and for me', 'BO-E-4S01-1', 'From Beneficiary', 'mt48 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293811, 'C0027402295', 'Published to Global Partner', 'Hello, dear Kimberly, I am your friend Sandra and I greet you in the name of Jesus. I thank you for the letter you sent me and for the present, with it I bought sports clothes and a pair of tennis shoes. Answering the question you made, I like the lunch they prepare at home and also the food from the church, especially the noodles soup. I want to tell you that classes started in school and also in the church Peña de Horeb where I met new friends, also in the church we learned more about the word of God. Thank God my family is fine and my mom works a lot so we can move forward. I like being with my brothers and taking care of my sister. This is my letter, I hope you like it, until the next letter. 2_ Please, pray for my mom and my brothers.', 'Hello, dear Kimberly, I am your friend Sandra and I greet you in the name of Jesus. I thank you for the letter you sent me and for the present, with it I bought sports clothes and a pair of tennis shoes. Answering the question you made, I like the lunch they prepare at home and also the food from the church, especially the noodles soup. I want to tell you that classes started in school and also in the church Peña de Horeb where I met new friends, also in the church we learned more about the word of God. Thank God my family is fine and my mom works a lot so we can move forward. I like being with my brothers and taking care of my sister. This is my letter, I hope you like it, until the next letter. 2_ Please, pray for my mom and my brothers.', 'BO-E-4S01-1', 'From Beneficiary', 'mt16 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293812, 'C0026382353', 'Published to Global Partner', 'Dear sponsor Anne. I send you greetings in the peace of our Lord Jesus Christ. Thank you for sending me this letter. Be happy. May our Lord Jesus Christ take care of you and protect you. I want to tell you that my family is fine. I really enjoy walking with my parents at the fair. On the holiday that passed, we were able to go shopping. My dad always tells me that I have to behave well and my mom tells me to study. In school, I study a lot and I learn a lot about mathematics. I like to go to recess and play with my classmates. I love learning about the word of God in the church with my friend Jhoselin. I hope you and your family are well. I send you a big hug with affection and a lot of love. Liz writes to you. 2. I ask you to pray for my family.', 'Dear sponsor Anne. I send you greetings in the peace of our Lord Jesus Christ. Thank you for sending me this letter. Be happy. May our Lord Jesus Christ take care of you and protect you. I want to tell you that my family is fine. I really enjoy walking with my parents at the fair. On the holiday that passed, we were able to go shopping. My dad always tells me that I have to behave well and my mom tells me to study. In school, I study a lot and I learn a lot about mathematics. I like to go to recess and play with my classmates. I love learning about the word of God in the church with my friend Jhoselin. I hope you and your family are well. I send you a big hug with affection and a lot of love. Liz writes to you. 2. I ask you to pray for my family.', 'BO-E-4S01-1', 'From Beneficiary', 'mt32 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', 'Shirley Jaldin', '09/02/2036 02:28', '03/2018', '2018-03-13 16:37:00'),
(293813, 'C0025875352', 'Published to Global Partner', 'Dear sponsor Lorel; I greet you with lots of affection and love, sending you a big hug. I thank you for the present you sent to me. I bought a sweater and a pair of sneakers. I also thank you for your beuatiful letter. In answer to your question: I do not like social studies very much because it is theory and history and it is complicated to learn it. Th worship song I like the most is of Barak- Te quiero adora because it talks about the love of God. The bible story I like the most is Pablo and Silas who sang hyimns to God. Alñlthough they were maltreated, they still had faith. I am praying for your kids and for your health, that God bless and take care of you. Love Yessica Amaru I ask you prayers for my studies and of my sisters Jhovana, Luz, Rosario and Ana', 'Dear sponsor Lorel; I greet you with lots of affection and love, sending you a big hug. I thank you for the present you sent to me. I bought a sweater and a pair of sneakers. I also thank you for your beuatiful letter. In answer to your question: I do not like social studies very much because it is theory and history and it is complicated to learn it. Th worship song I like the most is of Barak- Te quiero adora because it talks about the love of God. The bible story I like the most is Pablo and Silas who sang hyimns to God. Alñlthough they were maltreated, they still had faith. I am praying for your kids and for your health, that God bless and take care of you. Love Yessica Amaru I ask you prayers for my studies and of my sisters Jhovana, Luz, Rosario and Ana', 'BO-E-4S01-1', 'From Beneficiary', 'Works7 Communication', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293814, 'C0030297641', 'Printed and sent to ICP', '', 'Querida Carla, Gracias por tu carta. Mi escuela es genial. Tenemos muchas clases diferentes y todos los profesores son muy amables. Mis clases favoritas son música y costura. ¿Cuáles son tus clases favoritas en la escuela? Espero que tú y yo podamos seguir trabajando juntos para alcanzar nuestras metas y que ambos podamos crecer en nuestro amor por Cristo cada día y todos los días. Que el Señor te bendiga y te guarde, De tu patrocinadora, Zoe.', 'NZ-A-6S11-1', 'From Supporter', 'mt19 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293815, 'C0025928033', 'Published to Global Partner', '1. Dear sponsor Virginia, I send you lots of greetings in the name of our Lord Jesus Christ. I thank you for the support that you give me, it is very important for me. I like to play with my friends. I want to tell you that I went to the zoo with my family and we saw beautiful animals. Let me tell you that on vacation I traveled to my town and I had a lot of fun with my family. Also let me tell you that it is so cold where I live. My favorite sport is soccer. 2. I want you to pray for my family. With nothing left to say, I say goodbye hoping to hear from you soon. With affection, Roxana', '1. Dear sponsor Virginia, I send you lots of greetings in the name of our Lord Jesus Christ. I thank you for the support that you give me, it is very important for me. I like to play with my friends. I want to tell you that I went to the zoo with my family and we saw beautiful animals. Let me tell you that on vacation I traveled to my town and I had a lot of fun with my family. Also let me tell you that it is so cold where I live. My favorite sport is soccer. 2. I want you to pray for my family. With nothing left to say, I say goodbye hoping to hear from you soon. With affection, Roxana', 'BO-E-4S01-1', 'From Beneficiary', 'mt29 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293816, 'C0025307591', 'Published to Global Partner', 'Dear friend Jenyo Banjo; I greet you in the holy name of our beloved Lord, Jesus. I want to thank you for the letter you sent to me. I was on vacation and well, I took it seriously because I did nothing. I spent it wtahcing TV. I also played with my siblings. Now, classes started alerady and my vacation is over. I am in a new shcool, so I met new people and I hope to have good friends. I also tell you that I am practicing a lot to play the trumpet; it is something I like very much. Well, here in my country it is raining a lot and the rain is leaving many people homeless. It is a very sad situation. We only can pray for those people. Until other oportunity. Lots of love. May God bless you. Daniel Valero I ask you to pray for my family and for my studies. My drawing Psalms 23', 'Dear friend Jenyo Banjo; I greet you in the holy name of our beloved Lord, Jesus. I want to thank you for the letter you sent to me. I was on vacation and well, I took it seriously because I did nothing. I spent it wtahcing TV. I also played with my siblings. Now, classes started alerady and my vacation is over. I am in a new shcool, so I met new people and I hope to have good friends. I also tell you that I am practicing a lot to play the trumpet; it is something I like very much. Well, here in my country it is raining a lot and the rain is leaving many people homeless. It is a very sad situation. We only can pray for those people. Until other oportunity. Lots of love. May God bless you. Daniel Valero I ask you to pray for my family and for my studies. My drawing Psalms 23', 'BO-E-4S01-1', 'From Beneficiary', 'Works7 Communication', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293817, 'C0030297601', 'Printed and sent to ICP', '', 'Saludos desde Nueva Zelanda. Siempre es muy bueno oír acerca de ti, gracias por escribirnos. Esperamos y oramos por ti regularmente, para que seas bendecida en todo lo que hagas. ¡Estamos felices de oír que te va bien en la universidad! Geordie tiene 16 años de edad y tiene dos años más de escuela secundaria. Daisy tiene 12 años de edad y tiene muchos años más de secundaria. Hemos tenido un verano muy caluroso, el más caliente en muchos años y ahora es otoño. ¡A Geordie y a Daisy les encantan los deportes! Geordie juega básquet y vóley. Daisy ama un deporte llamado netball, del cual probablemente nunca habías oído antes. Anita trabaja en un café con sus padres y yo trabajo en una oficina en nuestra ciudad capital Wellington. Dios te bendiga y esperamos oír pronto de ti nuevamente ¡Algún día podremos enviarte fotos! Jeff, Anita, Geordie y Daisy.', 'NZ-A-6S11-1', 'From Supporter', 'admirable07 cbba', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293818, 'C0025794704', 'Published to Global Partner', 'Dear friend Catherine, I greet you in the peace of our Lord Jesus Christ. Thanks for the letter and present, I bought clothes, shoes and I want to thank you for the letter, I love reading your letter and know that you*re doing well, I*ll pray for your family and you. I want to tell you that in school classes started and I passed to 3º from High School. My favorite subjects are: Music, arts, language, English and psychology and I also met with my teachers, friends, and classmates again, the first day of school was interesting. In the Student Center our new tutor s Celina, she*s good and we*re learning about the subject God will be with you. I understood that God is the only one who guides me on my way to the milestone. I understood that God loves me. I also want to tell you that I have a new tutor called Celina. In my family, we*re a bit sick but we*ll get better because we*re in winter now. I say goodbye with lots of hugs. Rosio. 2_ Please, pray for the church where I attend.', 'Dear friend Catherine, I greet you in the peace of our Lord Jesus Christ. Thanks for the letter and present, I bought clothes, shoes and I want to thank you for the letter, I love reading your letter and know that you*re doing well, I*ll pray for your family and you. I want to tell you that in school classes started and I passed to 3º from High School. My favorite subjects are: Music, arts, language, English and psychology and I also met with my teachers, friends, and classmates again, the first day of school was interesting. In the Student Center our new tutor s Celina, she*s good and we*re learning about the subject God will be with you. I understood that God is the only one who guides me on my way to the milestone. I understood that God loves me. I also want to tell you that I have a new tutor called Celina. In my family, we*re a bit sick but we*ll get better because we*re in winter now. I say goodbye with lots of hugs. Rosio. 2_ Please, pray for the church where I attend.', 'BO-E-4S01-1', 'From Beneficiary', 'mt16 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
