(293820, 'C0028623327', 'Published to Global Partner', 'Dear sponsor Shirley Bishop. I greet you in the name of our Lord Jesus Christ. Thanks for the correspondence. I want to tell you that my sister Jhovana got married in December. There were many things to do but it was worth it because it was very beautiful. I want to tell you that I had a great time at Christmas because I celebrated it with the whole family. We shared, we danced and we stayed until 11 pm. Later, my mom, my siblings and I went to our house. In the new year, we shared with the parents of my sister*s husband. First, we went to my church. After that, we went to the home of my sister*s in-laws. First, we made consecrate my sister*s apartment. After that, we shared a meal. After that, we waited together with the pastor and his daughters for it to be 12 o*clock at night and the time came. My siblings, the pastor*s daughters and I went down to play with the fireworks. I say goodbye in the name of our Lord Jesus Christ. I also send many kisses and hugs for you and your whole family. With much affection and love, Aydee. 2. I ask you to pray for my studies and for the health of my whole family. my drawing: Galatians 6: 10', 'Dear sponsor Shirley Bishop. I greet you in the name of our Lord Jesus Christ. Thanks for the correspondence. I want to tell you that my sister Jhovana got married in December. There were many things to do but it was worth it because it was very beautiful. I want to tell you that I had a great time at Christmas because I celebrated it with the whole family. We shared, we danced and we stayed until 11 pm. Later, my mom, my siblings and I went to our house. In the new year, we shared with the parents of my sister*s husband. First, we went to my church. After that, we went to the home of my sister*s in-laws. First, we made consecrate my sister*s apartment. After that, we shared a meal. After that, we waited together with the pastor and his daughters for it to be 12 o*clock at night and the time came. My siblings, the pastor*s daughters and I went down to play with the fireworks. I say goodbye in the name of our Lord Jesus Christ. I also send many kisses and hugs for you and your whole family. With much affection and love, Aydee. 2. I ask you to pray for my studies and for the health of my whole family. my drawing: Galatians 6: 10', 'BO-E-4S01-1', 'From Beneficiary', 'mt32 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293821, 'C0026614176', 'Published to Global Partner', 'Dear friends Ryan and Amber Weiss; I greet you with lots of love and affection. Thanks for the letter you sent to me; I liked to get it. Thanks for the present. With it I bought. pants and a sweater. With my family we went to Yolasa where there was a water fall. We got in it because that places was very hot. In Christmas I celebrated with my family. We ate the traditional \" picana\" and we had sweet bread with hot chocolate. Classes started already. I have new teachers of other subjects like: biology, geography, history and chemistry. Until other opportunity. Love Your friend, Carlos I ask you to pray for my family. My drawing Love God loves you very much.', 'Dear friends Ryan and Amber Weiss; I greet you with lots of love and affection. Thanks for the letter you sent to me; I liked to get it. Thanks for the present. With it I bought. pants and a sweater. With my family we went to Yolasa where there was a water fall. We got in it because that places was very hot. In Christmas I celebrated with my family. We ate the traditional \" picana\" and we had sweet bread with hot chocolate. Classes started already. I have new teachers of other subjects like: biology, geography, history and chemistry. Until other opportunity. Love Your friend, Carlos I ask you to pray for my family. My drawing Love God loves you very much.', 'BO-E-4S01-1', 'From Beneficiary', 'Works7 Communication', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00'),
(293822, 'C0025221084', 'Published to Global Partner', '1. Dear sponsor Lynn Jensen, I send you greetings. I tell you that I was at home on my vacations playing with the cellphone and also watching television. I was with my mother and my brother helping them. It was night already and we went home. My family planned on going to Copacabana. We were excited but there was a problem and we didn?t go. Then, my planned on going to Las Alasitas on the last day of vacations and my father arrived early, we changed and went on many games. But my little brother wanted to go on all games. But my father didn?t bring much money and my little brother cried. But he stopped crying and they bought a decoration that he wanted. On the following day, he broke it. We used adhesive tape. And now I am excited about going back to school. I was changed the according uniform, had breakfast and went to school. I had lots of fun and I am in 5th ?A?. Some students left. But there isn?t any new one. I am doing well so far. I say goodbye with the peace of the Lord Jesus Christ. With love, Fabricio 2. I ask you to pray for my studies and for my family.', '1. Dear sponsor Lynn Jensen, I send you greetings. I tell you that I was at home on my vacations playing with the cellphone and also watching television. I was with my mother and my brother helping them. It was night already and we went home. My family planned on going to Copacabana. We were excited but there was a problem and we didn?t go. Then, my planned on going to Las Alasitas on the last day of vacations and my father arrived early, we changed and went on many games. But my little brother wanted to go on all games. But my father didn?t bring much money and my little brother cried. But he stopped crying and they bought a decoration that he wanted. On the following day, he broke it. We used adhesive tape. And now I am excited about going back to school. I was changed the according uniform, had breakfast and went to school. I had lots of fun and I am in 5th ?A?. Some students left. But there isn?t any new one. I am doing well so far. I say goodbye with the peace of the Lord Jesus Christ. With love, Fabricio 2. I ask you to pray for my studies and for my family.', 'BO-E-4S01-1', 'From Beneficiary', 'mt39 Malak', '09/02/2036 02:28', '', '00/00/0000 00:00', '09/02/2036', '', '00/00/0000 00:00', '03/2018', '2018-03-13 16:37:00');
